import React, { Component } from 'react';
import './card.css';
import './Title.js';


class Card extends Component {
    constructor (props) {
        super(props)

        this.state = {
            users: [],
            isFetch: true,
        }
    }

    componentDidMount(props) {
        fetch('https://randomuser.me/api')
        .then(res => res.json())
        .then(data => this.setState({ users: data.results, isFetch: false
            // const foto = data.results['0'].picture.large;
            // const nomb = data.results['0'].name.first;
            // console.log(data.results['0'])
        }))
    }

    render() {
        if (this.state.isFetch) {
            return 'Loading...'
        }
        const name = this.state.users[0].name
                // return <title name={name} />


        return (
            <div className="container">
                <div className="card">
                    <div className="sneaker">
                        <div className="circle"></div>
                        {/* <img src="./adidas.png" alt="adidas"> */}
                    </div>
                    <div className="info">
                        <title />
                        <h3 name={name}>Info</h3>

                        <div className="purchase">
                            {/* <button onClick={()=>{newUser()}}>Purchase</button> */}
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Card;
